import OpenAI from 'openai'

const openai = new OpenAI({
  // TODO: use constructed env instead
    apiKey: process.env.OPENAI_CLIENT_TOKEN ?? ''
})

const imageData = "";

export const getRoast = async(_imageData?: string) => {
    const result = await openai.chat.completions.create({
        model: "gpt-4o",
        messages: [
          {
            role: "user",
            content: [
              { type: "text", text: "Deliver a one-sentence roast for the individual in the provided image, focusing primarily on one characteristic at a time without positive reinforcement. Let the sarcasm flow freely." },
              {
                type: "image_url",
                image_url: {
                    "url": `data:image/jpg;base64,${imageData}`
                }
              },
            ],
          },
        ],
      });

      return result.choices[0]?.message.content;
}